<script id="csinit" type="text/x-cindyscript">
//Script (CindyScript)
rd1(x):=round(10*x)/10;
rd2(x):=round(100*x)/100;
rd3(x):=round(1000*x)/1000;
direction(AA,BB):=(BB-AA)/|BB-AA|;

R90=[[0,-1],[1,0]]; // for deriving normal from direction

fs=35;            // fontsize points
ns=25;            // fontsize paperstrip
ds=20;            // size of letters
sc=2.5;           // scale of  dir and nor points
nsc=1.2;          // scale of dir and nor paperstrip
dl=-[0.6,0.6];    // middle of points A,...
dls=-[0.9,0.6];   // middle of points A', ...
dln=-[0.4,0.6];   // middle of a,...
dlns=-[0.6,0.6];  // middle of a',...
dld=-[0.8,0.6];   // middle of distances
psw=2.5;          // paper strip width

//fonts="Helvetica";
//fonts="Microsoft Sens Serif";

//names=[["$c$","$d$","$p$","$a$"],
//       ["$b$","$a$","$p$","$d$"],
//       ["$c'$","$d'$","$p'$","$a'$"],
//       ["$b'$","$a'$","$p'$","$d'$"]];
names=[["c","d","p","a"],
       ["b","a","p","d"],
       ["c'","d'","p'","a'"],
       ["b'","a'","p'","d'"]];

paperstrip:=
  (fP=four;
   signn=[1,-1,1,-1];      // for positioning paper strip
   localc=zeromatrix(4,4); // local coordiantes
   repeat(4,ps,
     (dir=direction(fP_ps_1,fP_ps_4);
      nor=R90*dir;
        repeat(4,nn,
          (//println([fP_ps_nn,fP_ps_nn+nsc*nor,fP_ps_n+nsc*nor+dln]);
          if(ps<3,col=[1,1,0],col=[0,0,0]);
           drawtext(fP_ps_nn+1.2*signn_ps*nsc*nor+dln*(1.0+0.2*round(ps-1)),
                    names_ps_nn,size->ns,family->fonts,bold->true,color->col);
           
           //println([ps,nn,dir,fP_ps_nn-fP_ps_1,dir*(fP_ps_nn-fP_ps_1)]);
           localc_ps_nn=dir*(fP_ps_nn-fP_ps_1);
           );
               );
        // sort local coordinates
        localcs=sort([localc_ps_1,localc_ps_2,localc_ps_3,localc_ps_4]);
        //println([ps,localcs]);
        repeat(3,nn,
          (nn1=nn+1;pp=fP_ps_1+(localcs_nn+localcs_nn1)/2*dir;dist=localcs_nn1-localcs_nn;
          //drawtext(pp-signn_ps*nsc*nor+dld,rd1(dist),size->ds,family->fonts);
          );
              );
      );
        //bounding box of paper strip
        bb=[fP_ps_1+dir*(localcs_1-psw),
            fP_ps_1+dir*(localcs_1-psw)+signn_ps*nor*psw,
            fP_ps_1+dir*(localcs_4+psw)+signn_ps*nor*psw,
            fP_ps_1+dir*(localcs_4+psw),
            fP_ps_1+dir*(localcs_1-psw)];
        fillpoly(bb,alpha->0.2,color->[1,1,0]);
        drawpoly(bb,color->[0,0,0],size->2);
        );
     
   );


;

</script>
<script id="csdraw" type="text/x-cindyscript">
//Script (CindyScript)
//drawimage([+20,-5],[60,-5],"map.jpg");
if(Text4.pressed,,(
   drawimage([+20,-3],[60,-3],"map-osm.png");
   drawimage([-40,-3],[10,-3],"image-h.jpg");
   drawtext([-5,-4.5],"image taken by Geog Reifferscheid, 2005", size->15);
   drawtext([20,-4.5],"Open Street Map", size->15);
););

dirA=direction(A,C);
dirB=direction(B,D);
dirC=-dirA;
dirD=-dirB;
dirAs=direction(A',C');
dirBs=direction(B',D');
dirCs=-dirAs;
dirDs=-dirBs;
dirP=direction(P9,B)+direction(P9,C); dirP=dirP/|dirP|;
dirPs=direction(P14,B)+direction(P14,C); dirPs=dirPs/|dirPs|;
n1=R90*direction(E,D1);
n2=R90*direction(G,H);
n3=R90*direction(V,F');
n4=R90*direction(P8,P6);

drawtext(A.xy-sc*dirA+dl,"A",size->fs,family->fonts,bold->true,color->[1,1,0]);
drawtext(B.xy-sc*dirB+dl,"B",size->fs,family->fonts,bold->true,color->[1,1,0]);
drawtext(C.xy-sc*dirC+dl,"C",size->fs,family->fonts,bold->true,color->[1,1,0]);
drawtext(D.xy-sc*dirD+dl,"D",size->fs,family->fonts,bold->true,color->[1,1,0]);
drawtext(P9.xy-sc*dirP+dl,"P",size->fs,family->fonts,bold->true,color->[1,1,0]);
drawtext(A'.xy-sc*dirAs+dls,"A'",size->fs,family->fonts,bold->true);
drawtext(B'.xy-sc*dirBs+dls,"B'",size->fs,family->fonts,bold->true);
drawtext(C'.xy-sc*dirCs+dls,"C'",size->fs,family->fonts,bold->true);
drawtext(D'.xy-sc*dirDs+dls,"D'",size->fs,family->fonts,bold->true);
drawtext(P14.xy-sc*dirPs+dls,"P'",size->fs,family->fonts,bold->true);

four=[[E,K,P10,D1],
      [G,L,P11,H],
      [V,U,P12,F'],
      [P8,P7,P13,P6]];

paperstrip;



;

</script>
